// frontend/src/FriendList.js
import React from 'react';
import FriendCard from './FriendCard'; // FriendCardをインポート

const FriendList = ({ friends, onShowCard }) => {
  return (
    <div>
      <h2>送信された友達</h2>
      <ul>
        {friends.map((friend, index) => (
          <li key={index}>
            <div>
              <strong>名前:</strong> {friend.name} <br />
              <strong>出身地:</strong> {friend.hometown} <br />
              <strong>MBTI:</strong> {friend.mbti} <br />
              <strong>趣味:</strong> {friend.hobby} <br />
              <strong>好きな食べ物:</strong> {friend.favoriteFood} <br />
              <button onClick={() => onShowCard(friend)}>名刺を表示</button> {/* 名刺ボタン */}
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default FriendList;
